description:
Informed by Eric von Daniken's 1968 bestseller, Chariot of the Gods, this A&amp;E special investigates the theory that aliens visited Earth several thousand years ago. The report brings together expert testimony and recently unearthed artifacts that may indicate early man's knowledge of extraterrestrial beings. 

